export const ListLogFiles = () => {
  return (
    <div>
      <hr />
      <h3>Logfiles</h3>
      <ul>
        <li>Logfile 1</li>
        <li>Logfile 2</li>
        <li>Logfile 3</li>
      </ul>
    </div>
  );
};
